window.bookSummaryJSON = "<p>A morally gray necromancer, a playful fae, and a kindhearted vampire: all bound by one witch.</p> <p>When a vengeful demon burned her house down, Rain Carter had no choice but to move into the haven of Copperfield House with her boyfriend, Graham, her other boyfriend, Ezra, and his partner, Warren.</p> <p>She wants to believe she's safe here, but considering Warren's a murderer for hire...well, forgive her for being wary.</p> <p>But the deeper she falls into Warren's demons and desires, struggling to interpret visions from the mysterious woman in black, Rain fights a war within herself.</p> <p>Is blood sacrifice black and white, or could it be a million hues of gray?</p>"; 
